(16967, '_transient_acf_pro_get_remote_info', 'a:19:{s:4:\"name\";s:26:\"Advanced Custom Fields PRO\";s:4:\"slug\";s:26:\"advanced-custom-fields-pro\";s:7:\"version\";s:5:\"6.0.7\";s:8:\"homepage\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"author\";s:155:\"<a href=\"https://wpengine.com/?utm_source=wordpress.org&utm_medium=referral&utm_campaign=plugin_directory&utm_content=advanced_custom_fields\">WP Engine</a>\";s:12:\"contributors\";a:1:{s:12:\"elliotcondon\";a:3:{s:7:\"profile\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"avatar\";s:81:\"https://secure.gravatar.com/avatar/c296f449f92233e8d1102ff01c9bc71e?s=96&d=mm&r=g\";s:12:\"display_name\";s:22:\"Advanced Custom Fields\";}}s:8:\"requires\";s:3:\"4.7\";s:12:\"requires_php\";s:3:\"5.6\";s:6:\"tested\";s:5:\"6.1.1\";s:5:\"added\";s:10:\"2022-09-09\";s:12:\"last_updated\";s:10:\"2023-01-18\";s:11:\"description\";s:3553:\"<p>Advanced Custom Fields turns WordPress sites into a fully-fledged content management system by giving you all the tools to do more with your data.</p>\n\n<p>Use the Advanced Custom Fields plugin to take full control of your WordPress edit screens & custom field data.</p>\n\n<p><strong>Add fields on demand.</strong> Our field builder allows you to quickly and easily add fields to WP edit screens with only the click of a few buttons!</p>\n\n<p><strong>Add them anywhere.</strong> Fields can be added all over WP including posts, users, taxonomy terms, media, comments and even custom options pages!</p>\n\n<p><strong>Show them everywhere.</strong> Load and display your custom field values in any theme template file with our hassle free developer friendly functions!</p>\n\n<h4>Features</h4>\n<ul>\n<li>Simple & Intuitive</li>\n<li>Powerful Functions</li>\n<li>Over 30 Field Types</li>\n<li>Extensive Documentation</li>\n<li>Millions of Users</li>\n</ul>\n\n<h4>Links</h4>\n<ul>\n<li><a href=\"https://advancedcustomfields.com/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Website\">Website</a></li>\n<li><a href=\"https://advancedcustomfields.com/resources/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Website\">Documentation</a></li>\n<li><a href=\"https://support.advancedcustomfields.com\">Support</a></li>\n<li><a href=\"https://advancedcustomfields.com/pro/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">ACF PRO</a></li>\n</ul>\n\n<h4>PRO</h4>\n<p>The Advanced Custom Fields plugin is also available in a professional version which includes more fields, more functionality, and more flexibility!</p>\n\n<ul>\n<li>The <a href=\"https://www.advancedcustomfields.com/resources/repeater/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Repeater Field</a> allows you to create a set of sub fields which can be repeated again, and again, and again.</li>\n<li><a href=\"https://www.advancedcustomfields.com/resources/blocks/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">ACF Blocks</a>, a powerful PHP-based framework for developing custom block types for the WordPress Block Editor (aka Gutenberg).</li>\n<li>Define, create, and manage content with the <a href=\"https://www.advancedcustomfields.com/resources/flexible-content/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Flexible Content Field</a>, which provides for multiple layout and sub field options</li>\n<li>Use the <a href=\"https://www.advancedcustomfields.com/resources/options-page/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Options Page</a> feature to add custom admin pages to edit ACF fields.</li>\n<li>Build fully customisable image galleries with the <a href=\"https://www.advancedcustomfields.com/resources/gallery/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Gallery Field</a></li>\n<li>Unlock a more efficient workflow for managing field settings by reusing existing fields and field groups on demand with the <a href=\"https://www.advancedcustomfields.com/resources/clone/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Clone Field</a></li>\n</ul>\n\n<p><a href=\"https://advancedcustomfields.com/pro/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Pro%20Upgrade\">Upgrade to Pro</a></p>\";s:12:\"installation\";s:598:\"<p>From your WordPress dashboard</p>\n\n<ol>\n<li><strong>Visit</strong> Plugins > Add New</li>\n<li><strong>Search</strong> for \"Advanced Custom Fields\"</li>\n<li><strong>Install and Activate</strong> Advanced Custom Fields from your Plugins page</li>\n<li><strong>Click</strong> on the new menu item \"Custom Fields\" and create your first Custom Field Group!</li>\n<li><strong>Read</strong> the documentation to <a href=\"https://advancedcustomfields.com/resources/getting-started-with-acf/?utm_source=wordpress.org&utm_medium=free%20plugin%20listing&utm_campaign=ACF%20Website\">get started</a></li>\n</ol>\";s:9:\"changelog\";s:7628:\"<h4>6.0.7</h4>\n<p><em>Release Date 18th January 2023</em></p>\n\n<ul>\n<li>Improvement - Removed unnecessary “Layout” prefix for Flexible Content field layouts</li>\n<li>Fix - Dragging and dropping fields containing settings rendered as radio button groups no longer removes the selected value</li>\n<li>Fix - Using the WordPress <code>default_page_template_title</code> filter with two parameters no longer causes a fatal error</li>\n<li>Fix - Select2 inputs in the content editor are no longer receiving styles from the ACF 6 admin UI</li>\n<li>Fix - <code>acf_add_local_field_group()</code> now works with field group titles containing non-ASCII characters</li>\n<li>Fix - Flexible Content field no longer has a missing icon for the “Duplicate” button</li>\n<li>Fix - Clicking the “Add Field” button in a Flexible Content layout no longer adds an invalid field if there are other Flexible Content fields in the layout</li>\n<li>Fix - Edit buttons for ACF blocks now behave correctly inside reusable blocks </li>\n<li>Fix - Field settings rendered as a select2 field now correctly reinitialize when changing between field types</li>\n</ul>\n\n<h4>6.0.6</h4>\n<p><em>Release Date 13th December 2022</em></p>\n\n<ul>\n<li><a href=\"https://www.advancedcustomfields.com/blog/acf-6-0-6-release-flexible-content-field-layout-improvement/\">View Release Post</a></li>\n<li>New - Flexible Content field now has a new admin user experience when editing layouts</li>\n<li>New - Tabs for field settings in the field group editor can now be disabled via a new “Field Settings Tabs” screen option or with the new <a href=\"https://www.advancedcustomfields.com/resources/acf-field_group-disable_field_settings_tabs\"><code>acf/field_group/disable_field_settings_tabs</code></a> filter</li>\n<li>Improvement - General field settings tab now selected by default when a field is opened</li>\n<li>Fix - Sub fields are no longer initialized by their parent, resolving performance issues when field groups contain many nested sub fields</li>\n<li>Fix - Frontend forms now disable the submit button after click to prevent multiple submissions</li>\n<li>Fix - Unknown field types no longer display broken HTML in the field group editor</li>\n<li>Fix - Returning an empty string via the <code>acf/blocks/no_fields_assigned_message</code> filter will no longer result in blocks without fields assigned having an extra wrapping div</li>\n<li>Fix - Sites with WPML enabled no longer experience failed ACF updates due to license errors</li>\n<li>Fix - Buttons featuring icons no longer have display issues when using RTL languages</li>\n</ul>\n\n<h4>6.0.5</h4>\n<p><em>Release Date 18th November 2022</em></p>\n\n<ul>\n<li>Fix - Uploading multiple files nested in a subfield no longer causes a fatal error when using basic uploader (props @JoKolov)</li>\n</ul>\n<p>* Switched to v2 of the Blocks API for WordPress 5.6+</p>\n<p>* Block preloading now enabled by default</p>\n<p>* Block preloading now supports blocks set to \"Edit\" mode</p>\n<p>* Add support for full height alignment setting</p>\n<ul>\n<li>Enhancement - Added setting to color picker field to enable an opacity slider</li>\n<li>Enhancement - Allow deletion of first field group location rule if multiple rules have been added thanks to Arthur Shlain</li>\n<li>Fix - Fixed vulnerability with <code>acf_shortcode()</code> where users with subscriber role could view arbitrary ACF data, thanks to Keitaro Yamazaki</li>\n<li>Fix - Fixed vulnerability where users with subscriber role could move fields and view field groups, thanks to Keitaro Yamazaki</li>\n<li>Fix - Fixed issue where fields in legacy widgets weren\'t saving in new widget block editor</li>\n<li>Fix - Fixed issue with custom field validation in scheduled posts</li>\n<li>Fix - Fixed warnings thrown by clone field if the cloned field group is empty</li>\n<li>Fix - Fixed issue where Select2 search input wouldn\'t have focus in WordPress 5.8+</li>\n<li>Fix - Fixed issue with Select2 value sorting when Yoast SEO is installed</li>\n<li>Fix - Fixed deprecation warnings in block editor in WordPress 5.6+</li>\n<li>i18n - Updated Swedish translation thanks to Erik Betshammar</li>\n</ul>\n<p>* Added toolbar across all ACF admin pages.</p>\n<p>* Added new table columns: Description, Key, Location, Local JSON.</p>\n<p>* Added popup modal to review Local JSON changes before sync.</p>\n<p>* Added visual representation of where Field Groups will appear.</p>\n<p>* Added new help tab.</p>\n<p>* Simplified layout.</p>\n<ul>\n<li>Enhancement - New ACF Blocks features.</li>\n</ul>\n<p>* Added support for Inner Blocks.</p>\n<p>* Added new \"jsx\" setting.</p>\n<p>* Added new \"align_text\" settings.</p>\n<p>* Added new \"align_content\" settings.</p>\n<ul>\n<li>Enhancement - Added duplicate functionality for Repeater and Flexible Content fields.</li>\n<li>Enhancement - Added PHP validation support for Gutenberg.</li>\n<li>Enhancement - Added ability to bypass confirmation tooltips (just hold shift).</li>\n<li>Enhancement - Local JSON files now save back to their loaded source path (not \"save_json\" setting).</li>\n<li>Tweak - Replaced all custom icons with dashicons.</li>\n<li>Tweak - Changed custom post status label from \"Inactive\" to \"Disabled\".</li>\n<li>Tweak - Improved styling of metaboxes positioned in the block editor sidebar.</li>\n<li>Fix - Improved AJAX request efficiency when editing block className or anchor attributes.</li>\n<li>Fix - Fixed bug causing unresponsive WYSIWYG fields after moving a block via the up/down arrows.</li>\n<li>Fix - Fixed bug causing HTML to jump between multiple instances of the same Reusable Block.</li>\n<li>Fix - Fixed bug sometimes displaying validation errors when saving a draft.</li>\n<li>Fix - Fixed bug breaking Image field UI when displaying a scaled portrait attachment.</li>\n<li>Fix - Fixed bug in Link field incorrectly treating the \"Cancel\" button as \"Submit\".</li>\n<li>Fix - Fixed bug where a sub field within a collapsed Repeater row did not grow to the full available width.</li>\n<li>Fix - Ensured all archive URLs shown in the Page Link field dropdown are unique.</li>\n<li>Fix - Fixed bug causing incorrect conditional logic settings on nested fields when duplicating a Field Group.</li>\n<li>Fix - Fixed bug causing license activation issues with some password management browser extensions.</li>\n<li>Dev - Major improvements to <code>ACF_Location</code> class.</li>\n<li>Dev - Refactored all location classes to optimize performance.</li>\n<li>Dev - Extracted core JavaScript from \"acf-input.js\" into a separate \"acf.js\" file.</li>\n<li>Dev - Field Group export now shows \"active\" attribute as bool instead of int.</li>\n<li>Dev - Added filter \"acf/get_object_type\" to customize WP object information such as \"label\" and \"icon\".</li>\n<li>Dev - Added action \"acf/admin_print_uploader_scripts\" fired when printing uploader (WP media) scripts in the footer.</li>\n<li>Dev - Added filters \"acf/pre_load_attachment\" and \"acf/load_attachment\" to customize attachment details.</li>\n<li>Dev - Added filter \"acf/admin/toolbar\" to customize the admin toolbar items.</li>\n<li>Dev - Added new JS actions \"duplicate_fields\" and \"duplicate_field\" fired when duplicating a row.</li>\n<li>i18n - Changed Croatian locale code from \"hr_HR to \"hr\".</li>\n<li>i18n - Updated Portuguese translation thanks to Pedro Mendonça.</li>\n<li>i18n - Updated French Canadian translation thanks to Bérenger Zyla.</li>\n<li>i18n - Updated French translation thanks to Maxime Bernard-Jacquet.</li>\n<li>i18n - Updated German translations thanks to Ralf Koller.</li>\n</ul>\n\n<p><a href=\"https://www.advancedcustomfields.com/changelog/\">View the full changelog</a></p>\";s:14:\"upgrade_notice\";s:0:\"\";s:5:\"icons\";a:1:{s:7:\"default\";s:63:\"https://ps.w.org/advanced-custom-fields/assets/icon-256x256.png\";}s:7:\"banners\";a:2:{s:3:\"low\";s:77:\"https://ps.w.org/advanced-custom-fields/assets/banner-772x250.jpg?rev=1729102\";s:4:\"high\";s:78:\"https://ps.w.org/advanced-custom-fields/assets/banner-1544x500.jpg?rev=1729099\";}s:8:\"versions\";a:161:{i:0;s:5:\"6.0.6\";i:1;s:5:\"6.0.5\";i:2;s:5:\"6.0.4\";i:3;s:5:\"6.0.3\";i:4;s:5:\"6.0.2\";i:5;s:5:\"6.0.1\";i:6;s:11:\"6.0.0-beta1\";i:7;s:12:\"6.0.0-alpha4\";i:8;s:12:\"6.0.0-alpha3\";i:9;s:12:\"6.0.0-alpha2\";i:10;s:12:\"6.0.0-alpha1\";i:11;s:9:\"6.0.0-RC3\";i:12;s:9:\"6.0.0-RC2\";i:13;s:9:\"6.0.0-RC1\";i:14;s:5:\"6.0.0\";i:15;s:5:\"5.9.9\";i:16;s:5:\"5.9.8\";i:17;s:5:\"5.9.7\";i:18;s:5:\"5.9.6\";i:19;s:5:\"5.9.5\";i:20;s:5:\"5.9.4\";i:21;s:5:\"5.9.3\";i:22;s:5:\"5.9.2\";i:23;s:5:\"5.9.1\";i:24;s:11:\"5.9.0-beta5\";i:25;s:11:\"5.9.0-beta4\";i:26;s:11:\"5.9.0-beta3\";i:27;s:11:\"5.9.0-beta2\";i:28;s:11:\"5.9.0-beta1\";i:29;s:9:\"5.9.0-RC1\";i:3